theme.source:
@theme-name: t-menu-default;

.@{theme-name} {
  overflow: visible;
  .w-menu-divider {
    display: none;

    .w-menu-divider-item {
      display: none;
    }
  }

  .w-menu-item,
  .w-menu-divider,
  .w-menu-item a {
    display: inline-block;
    *display: inline;
    zoom: 1;
  }

  .w-menu-item {
    a,
    a:visited {
      padding: 5px 20px;
      text-decoration: none;
    }

    a:hover,
    a:active {
      text-decoration: none;
    }
  }

  .w-submenu-list {
    white-space:nowrap;
    white-space:nowrap;
    min-width:96px;
    top:26px;
    background:rgba(255, 255, 255, .9);
  }

  .active .w-submenu-list a,
  .active .w-submenu-list a:visited,
  .active .w-submenu-list a:hover,
  .active .w-submenu-list a:active {
    padding:5px 20px;
  }
  .w-submenu-list a:hover, .active .w-submenu-list a:hover {
    text-decoration:underline;
  }
}

@theme-name: t-menu-00-6dbc0c;

.@{theme-name} {
  height: 40px;
  overflow: visible;

  .w-menu-list {
    height: 40px;
  }

  .w-menu-divider {
    padding: 0 10px;
    position: relative;

    .w-menu-divider-item {
      position: absolute;
      top: -16px;
      left: 10px;
      width: 1px;
      height: 21px;
      background-color: #d6d6d6;
    }
  }

  .w-menu-item,
  .w-menu-divider,
  .w-menu-item a {
    display: inline-block;
    *display: inline;
    zoom: 1;
  }

  .w-menu-item {
    a,
    a:visited {
      padding: 11px 20px;
      font-size: 16px;
      height: 40px;
      line-height: 18px;
      text-decoration: none;
      -webkit-transition: background-color 0.2s ease 0s;
      -ms-transition: background-color 0.2s ease 0s;
      -moz-transition: background-color 0.2s ease 0s;
      -o-transition: background-color 0.2s ease 0s;
      transition: background-color 0.2s ease 0s;
      color: #444444;
    }

    a:hover,
    a:active {
      text-decoration: none;
      color: #6dbc0c;
    }
  }

  .active a,
  .active a:visited,
  .active a:hover,
  .active a:active {
    background-color: #f3f4f4;
    -webkit-border-radius: 2px;
    -ms-border-radius: 2px;
    -moz-border-radius: 2px;
    -o-border-radius: 2px;
    border-radius: 2px;
    color: #444444;
  }

  .w-submenu-list {
    white-space:nowrap;
    white-space:nowrap;
    min-width:96px;
    top:40px;
    background:rgba(255, 255, 255, .9);
  }

  .w-submenu-list a {
    color: #444444;
  }

  .active .w-submenu-list a:hover {
    color: #6dbc0c;
  }
  .active .w-submenu-list a,
  .active .w-submenu-list a:visited,
  .active .w-submenu-list a:hover,
  .active .w-submenu-list a:active {
    background:none;
  }
  .w-submenu-list a:hover, .active .w-submenu-list a:hover {
    text-decoration:underline;
  }
}

